import Dog from "./Dog";
import React, { useState } from "react";
import "../stylesheets/layouts/DogList.scss";

const DogList = (props) => {
  const handleClickPrev = () => {
    setIndex(index - 1);
  };
  const handleClickSig = () => {
    setIndex(index + 1);
  };
  const [index, setIndex] = useState(0);
  return (
    <>
      <li key={props.dogs.id} className="dogList">
        <Dog dogs={props.dogs[index]} />
      </li>
      {index < props.dogs.length ? (
        <button onClick={handleClickSig}>Siguiente</button>
      ) : null}
      {index > 0 ? <button onClick={handleClickPrev}>Anterior</button> : null}
    </>
  );
};

export default DogList;
